function CompC() {
    return (
        <>
            <firstName.Consumer>
                {(fsName) => {

                    return <h1>{fsName[0].name}</h1>
                    fsName.map((item) => {
                        return <h2>{item.name}</h2>
                    })
                }}
            </firstName.Consumer>

        </>
    )
}
export default CompC
